int binarySearch(vector<int> data, int val)
{

    int start = 0;
    int end = data.size() - 1;
    int mid;
    //edge case
    while (start <= end)
    {
        count3++;
        mid = (end + start) / 2;
        if (data.at(mid) == val)
        {
            count3++;
            return mid;
        }
        else
        {
            if (val > data.at(mid))
            {
                count3++;
                end = mid - 1;
            }
            else
            {
                start = mid + 1;
                count3++;
            }
        }
    }

    return -1;
}

int getRange(vector<int> data)
{
    int start;
    int end;

    while (true)
    {
        cout << "Introducir matricular menor" << endl;
        cin >> start;
        cout << "Introducir matricular mayor" << endl;
        cin >> end;
        if (start > end)
        {
            cout << "Rango invalido o rangos iguales" << endl;
            return -1;
        }
        int rangeStart = binarySearch(data, start);
        int rangeEnd = binarySearch(data, end);

        if (rangeStart == -1 || rangeEnd == -1)
        {
            cout << "Uno o mad de los valores no son validos!" << endl;
            return -1;
        }

        cout << "Matriculas en los rangos" << start << " a " << end << ": " << rangeStart - rangeEnd << endl;
        cout << "comparaciones = 2 *logn  = " << count3 << endl;
        count3 = 0;
    }
}

