int merge(int *, int *, int, int, int);
void mergeStandard(int *a, int *b, int low, int high)
{
    int pivot;
    if (low < high)
    {
        count1 += 1;
        pivot = (low + high) / 2;
        mergeStandard(a, b, low, pivot);
        mergeStandard(a, b, pivot + 1, high);
        count1 += merge(a, b, low, pivot, high);
    }
}
void mergeThree(int *a, int *b, int low, int high)
{
    int pivot;
    if (high - low >= 1)
    {
        count2 += 1;
        int midLow = low + (high - low) / 3;
        int midHigh = low + 2 * ((high - low) / 3) + 1;

        mergeThree(a, b, low, midLow);
        mergeThree(a, b, midLow + 1, midHigh);
        mergeThree(a, b, midHigh + 1, high);

        count2 += merge(a, b, low, midLow, midHigh);
        count2 += merge(a, b, low, midHigh, high);
    }
}
int merge(int *a, int *b, int low, int pivot, int high)
{
    int h, i, j, k;
    h = low;
    i = low;
    j = pivot + 1;
    int count = 0;

    while ((h <= pivot) && (j <= high))
    {

        if (a[h] <= a[j])
        {
            count++;
            b[i] = a[h];
            h++;
        }
        else
        {
            b[i] = a[j];
            j++;
            count++;
        }
        i++;
    }
    if (h > pivot)
    {
        count++;
        for (k = j; k <= high; k++)
        {
            count++;
            b[i] = a[k];
            i++;
        }
    }
    else
    {
        count++;
        for (k = h; k <= pivot; k++)
        {
            count++;
            b[i] = a[k];
            i++;
        }
    }
    for (k = low; k <= high; k++)
    {
        count++;
        a[k] = b[k];
    }
    return count;
}

